import React from 'react';
import { useFormik } from 'formik';

const Signup = () => {
    const formik = useFormik({
        initialValues: {
            firstName: "",
            lastName: "",
            email: "",
            password: "",
            favSeason: "",
        }
    })
    return (
        <form>
            <div className="container-fluid">
              <div className="row">
                <div className="col-md-6"></div>
                <div className="col-md-6"></div>
              </div>
            </div>
        </form>
    );
}

export default Signup;
